import React, { Component } from "react";
import ReactMarkDown from "react-markdown";

class TestComponent extends Component {
  state = {};
  render() {
    return (
      <div>
        <ReactMarkDown source="# h1\n## h2\n### h3\n #### h4\n ##### h5" />
      </div>
    );
  }
}

export default TestComponent;
